  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides sedimentary environments
  of the Hudson River Estuary from Verrazano Narrows Bridge to Troy. Areas of the
  Hudson River shallower than 4 meters have not been surveyed and sampled completely.
  The sedimentary environment interpretation is based on the evaluation of Chirp sub-bottom
  acoustic profiler data in conjunction with acoustic backscatter and bathymetry data.
  It is subdivided into depositional, erosional, and dynamic classes that are further
  subdivided, depending on the details identified in the sub-bottom data, or because
  of their location. A more complete description of this interpretation can be found
  in Nitsche et al. (2004) and Nitsche et al. (2005)\",\n\t\"license_title\": null,\n\t\"extras\":
